meta.dataGenCode:

$Candles {
    name=Ape Tether US Binance | data=@(APEUSDT, 1h, 1000)
}
+ SuperBands {
    name=SuperBands | 
    settings = { precision: 3 } |
    data = (async () => {
        let kc1 = await ta.keltner(hcl, 50, 3)
        let kc2 = await ta.keltner(hcl, 50, 4)
        let kc3 = await ta.keltner(hcl, 50, 5)

        let out = []

        for (var i = 0; i < kc3.length; i++) {
            out.push([
                kc3[i][0], 
                kc2[i][0],
                kc1[i][0],
                kc1[i][2],
                kc2[i][2],
                kc3[i][2]
            ])
        }

        return out
    })() 
};
